function drawSub(idx) {

  if (idx == 1) {
    itemData = morning
    range = range1
  } else if (idx == 2) {
    itemData = evening
    range = range1
  } else if (idx == 0) {
    itemData = itemData1
    range = range2
  } else if (idx == 4) {
    itemData = firstData
    range = [0, 1]
  } else if (idx == 5) {
    itemData = randomData;
    range = [4, 380]
  } else if (idx == 6) {
    itemData = zeroData;
    range = [0, 0]
  }else if(idx ==7 ){
    itemData = randomData2;
    range = [4, 380]
  }
  console.log(range)
  const flow_colors = ["#55ffff", "#00ff00", "#ffeb3b", "#ffa726", '#f14747']
  let line_flag = [0, 0, 0, 0, 0, 0, 0, 0, 0]
  let flow_size = [3, 12, 16, 30]
  let flow_num = [range[0] + (range[1] - range[0]) / 4, range[0] + (range[1] - range[0]) / 2, range[0] + (range[1] - range[0]) / 4 * 3]

  for (let i in itemData) {
    //设置itemStyle：根据进站人数的不同来设置
    var flow = itemData[i]["value"][2] //进站人数
    console.log(itemData[i]["name"], itemData[i]["value"])
    /*
      归一化Min-Max Normalization
   x' = (x - X_min) / (X_max - X_min)
 */

    if (idx != 4 && idx != 6) {
      itemData[i]["symbolSize"] = flow_size[0] + (flow - range[0]) / (range[1] - range[0]) * (flow_size[3] - flow_size[0])
    } else {
      itemData[i]["symbolSize"] = flow * 10
    }
    if (flow < 20 && idx != 4) {
      itemData[i]["symbolSize"] = 0
    }
    //设置tooltip
    itemData[i]["tooltip"] = {
      formatter: function (param) {
        return param.name + " 人流量:" + param.value[2] + "人";
      }
    }
  }
  let subwayDom = document.getElementById("subway-graph")
  let subwayChart = echarts.init(subwayDom)
  //线的不同粗细
  let lineWid = [0.05, 5, 8]
  let series = []

  for (let i in lineData) {
    let temCoords = []
    lineData[i]["tooltip"] = {
      formatter: (p) => {
        return 'line_' + linesName[i]
      }
    }

    temCoords.push(lineData[i])

    let temSeires = {
      id: 'line_' + linesName[i],
      type: 'lines',
      coordinateSystem: 'cartesian2d', //使用直角坐标
      polyline: true,
      effect: {
        show: true
      },
      smooth: true,
      lineStyle: {
        width: lineWid[0],
        color: "#ffffff", // 0% 处的颜色
        opacity: 1
      },
      zlevel: 0,
      data: temCoords,

    }
    series.push(temSeires)
  }
  series.push({
    type: 'effectScatter',
    symbol: "circle",
    //"image://../img/train.png" 
    symbolSize: flow_size[1],
    effectType: 'ripple',
    rippleEffect: {
      brushType: "stroke"
    },
    data: itemData,
    /*itemStyle: {
      borderColor: flow_colors[0],
      color: '#ffffff',
      borderWidth: 3,
      opacity: 0.8
    },*/
    zlevel: 1,
  })
  /*插入列车图标
  series.push({
    type: 'effectScatter',
    symbol:"image://../img/train.png" ,
    symbolSize:40, 
    rippleEffect: {
      brushType: "fills",
      scale:1
    },
    //"image://../img/train.png" 
    data: [{
      'name': 'Sta155',
      'value': [600, 520]
    }, 
    {
      'name': 'Sta51',
      'value': [550, 520]
    }, ],
    /*itemStyle: {
      borderColor: flow_colors[0],
      color: '#ffffff',
      borderWidth: 3,
      opacity: 0.8
    },
    zlevel: 1,
  })*/
  let option = {
    title: {
      text: ' ',
      textStyle: {
        color: 'white'
      },
      top: '2%',
      left: '45%'
    },
    // backgroundColor: '#323c48', //背景颜色
    tooltip: {},
    label: {},
    grid: {
      width: '93%',
      height: '80%',
      left: '2%',
    },
    //实现缩放的功能
    dataZoom: [{
      type: 'inside',
      xAxisIndex: [0],


    }, {
      type: 'inside',
      yAxisIndex: [0],
    }],
    //xAxis和yAixs的max表示的是同一个width或height对应的不同段数 16：9来绘图
    xAxis: {
      show: false,
      min: 0,
      max: 1550,
      type: "value",
      //开启x轴坐标
      axisPointer: {
        show: false
      },
    },
    yAxis: {
      show: false,
      min: 0,
      max: 900,
      type: "value",
      //开启y轴坐标
      axisPointer: {
        show: false
      },
    },
    visualMap: {
      orient: 'vertical',
      type: 'continuous',
      left: '5%',
      bottom: '15%',
      min: range[0],
      max: range[1],
      splitNumber: 4,
      text: ['High Nums', 'Low Nums'],
      textStyle: {
        color: '#fff'
      },
      seriesIndex: 9,
      color: flow_colors.reverse()
    },
    series: series
  }
  subwayChart.setOption(option)
  subwayChart.on('click', function (param) {
    //self.location.href = "../system/pages/3D.html"
    //点击线路
    if (param.seriesType == "lines") {
      idx = param.seriesIndex
      //标记
      if (line_flag[idx] == 0) {
        line_flag[idx] = 1
        series[idx].lineStyle = {
          width: lineWid[2],
          color: '#067e90', // 0% 处的颜色
          opacity: 1
        }

      } else {
        series[idx].lineStyle = {
          width: lineWid[0],
          color: '#ffffff', // 0% 处的颜色
          opacity: 1
        }
        line_flag[idx] = 0
      }

      //绘图,数据包括换乘站
      let lineId = param.seriesId.split("+")[0]
      let totalIn = totalInSta[lineId]
      let totalOut = totalOutSta[lineId]
      // console.log()
      drawLineSac(lineId, totalIn, totalOut)
      drawTimeLine(lineId, totalTimeIn[lineId], totalTimeOut[lineId])
      subwayChart.setOption(option)

    }
    //点击散点
    if (param.seriesType == "scatter" || param.seriesType == "effectScatter") {

      let staName = param.name
      console.log(staName, totalStaIn[staName], totalStaOut[staName])
      drawTimeLine(staName, totalStaIn[staName], totalStaOut[staName])
      // print(staName)
    }
  });
}

