function getTime() {
  let date = new Date();
  let year = date.getFullYear();
  let m = date.getMonth();
  let d = date.getDay();
  let h = date.getHours();
  let min = date.getMinutes();
  time = year + '-' + m + '-' + d + ' ' + h + ':' + min
  return time
}

